	add("church", "{\"term\":\"church\", \"etymology\":{\"influencers\":[{},{},{},{},{},{},{}], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"middle english (1100-1500)\", \"ancient greek (to 1453)\", \"scots\", \"saterfriesisch\"], \"text\":\"From Middle english (1100-1500) \u0027chirche\u0027 from Old english (ca. 450-1100) {{m|ang|ċiriċe||church}}, from Proto-germanic {{m|gem-pro|*kirikǭ}}, an early borrowing of Ancient greek (to 1453) \u0027κυριακόν\u0027 neuter form of \u0027κυριακός\u0027 (belonging to the lord) from \u0027κύριος\u0027 (ruler, lord) from Proto-indo-european {{m|ine-pro|*ḱēw-}}, {{m|ine-pro|*ḱwā-||to swell, spread out, be strong, prevail}}.{{rel-top|additional etymological information}} For vowel evolution, see \u0027\u0027 Greek \u0027κυριακόν\u0027 was used of houses of Christian worship since circa 300 AD, especially in the East, though it was less common in this sense than \u0027ἐκκλησία\u0027 (congregation) or \u0027βασιλική\u0027 (royal thing) An example of the direct Greek-to-Germanic progress of many Christian words, via the w:Goths|Goths; it was probably used by West Germanic people in their pre-Christian period. Cognate with Scots \u0027kirk\u0027 (church) West Frisian \u0027tsjerke\u0027 (church) Saterfriesisch \u0027säärke\u0027 (church) Dutch \u0027kerk\u0027 (church) German \u0027kirche\u0027 (church) Danish \u0027kirke\u0027 (church) Swedish \u0027kyrka\u0027 (church) Norwegian \u0027kirke\u0027 \u0027kyrkje\u0027 (church) and Icelandic \u0027kirkja\u0027 (church) Also picked up by Slavic, via Old High German \u0027chirihha\u0027 (compare Old Church Slavonic \u0027sc\u003dcyrs\u0027 Bulgarian \u0027църква\u0027 Russian \u0027це́рковь\u0027 . w:Romance languages|Romance and w:Celtic languages|Celtic languages use variants of Latin \u0027ecclesia\u0027 {{rel-bottom}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Image:St Mary\u0027s Catherdral, thumb|right|A church, with many architectural features traditional to such a structure\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A Christian house of worship; a building where religious services take place\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"There is a lovely little \u0027\u0027church\u0027\u0027 in the valley\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"This building used to be a \u0027\u0027church\u0027\u0027 before being converted into a library\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Christians collectively seen as a single spiritual community; Christianity\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"These worshippers make up the \u0027\u0027Church\u0027\u0027 of Christ\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Acts 20:28, New International Version\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Be shepherds of the \u0027\u0027church\u0027\u0027 of God, which he bought with his own blood\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A local group of people who follow the same Christian religious beliefs, local or general\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"A particular denomination of Christianity\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027Church\u0027\u0027 of England separated from the Roman Catholic \u0027\u0027Church\u0027\u0027 in 1534\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"Christian worship held at a church; service\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"A (non-Christian) religion; a religious group\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, Scott A. Merriman, \u0027Religion and the Law in America\u0027, [http://books.google.co.uk/books?id\u003dl_8VFygyaDYC\u0026amp;pg\u003dPA312\u0026amp;dq\u003d page 313\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"Among these, the \u0027\u0027church\u0027\u0027 must investigate fundemental questions\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"She goes to a Wiccan \u0027\u0027church\u0027\u0027 down the road\", \"priority\":16}]}, \"synonyms\":{}}");

