	add("chutzpah", "{\"term\":\"chutzpah\", \"etymology\":{\"influencers\":[], \"languages\":[\"official aramaic (700-300 bce)\", \"English\", \"Hebrew\", \"Yiddish\"], \"text\":\"Originated 1890–95 from Yiddish \u0027חוצפּה\u0027 from Mishnaic Hebrew \u0027חֻצְפָּה\u0027 from \u0027חָצַף\u0027 (tr\u003dkhátsaf) Ultimately from Official aramaic (700-300 bce) \u0027חוצפא\u0027 \u0027חֲצַף\u0027 (tr\u003dḥaṣap)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Nearly arrogant courage; utter audacity, effrontery or impudence; supreme self-confidence; exaggerated self-opinion\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"22/01/2007\u0027\u0027, The Times, [http://www.timesonline.co.uk/article/0,,641-2560365,00.html Modern Manners\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"If the service is rotten and the meal a disaster, we should withhold a tip and explain why we are doing so. Few of us have the \u0027\u0027chutzpah\u0027\u0027 to do this\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"12/11/2007\u0027\u0027, John Scalzi, Whatever, [http://whatever.scalzi.com/2007/11/12/your-creation-museum-report/ Your Creation Museum Report\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"But seriously, the ability to just come out and put on a placard that the Jurassic era is temporally contiguous with the Fifth Dynasty of the Old Kingdom of Egypt — well, there’s a word for that, and that word is \u0027\u0027chutzpah\", \"priority\":5}]}, \"synonyms\":{}}");

